"ᴡʜᴀᴛ🥀'ꜱ ʏᴏᴜʀ ꜰᴀᴠᴏʀɪᴛᴇ ᴅʀɪɴᴋ? ɪ🥀'ᴍ ᴀꜱᴋɪɴɢ ꜱᴏ ɪ ᴋɴᴏᴡ ᴡʜᴀᴛ ᴛᴏ ʙᴜʏ ʏᴏᴜ ᴏɴ ᴏᴜʀ ꜰɪʀꜱᴛ ᴅᴀᴛᴇ❤️😘.",
"ʜᴀᴠᴇ ᴡᴇ ᴍᴇᴛ? ʙᴇᴄᴀᴜꜱᴇ ʏᴏᴜ ʟᴏᴏᴋ ᴇxᴀᴄᴛʟʏ ʟɪᴋᴇ ᴍʏ ɴᴇxᴛ ʙᴏʏꜰʀɪᴇɴᴅ/ɢɪʀʟꜰʀɪᴇɴᴅ/ᴘᴀʀᴛɴᴇʀ❤️😘.",
"ɪ ɴᴇᴠᴇʀ ʙᴇʟɪᴇᴠᴇᴅ ɪɴ ʟᴏᴠᴇ ᴀᴛ ꜰɪʀꜱᴛ ꜱɪɢʜᴛ, ʙᴜᴛ ᴛʜᴀᴛ🥀'ꜱ ʙᴇꜰᴏʀᴇ ɪ ꜱᴀᴡ ʏᴏᴜ❤️😘.",
"ᴅᴏ ʏᴏᴜ ʜᴀᴠᴇ ᴀ ᴍᴀᴘ? ʙᴇᴄᴀᴜꜱᴇ ɪ ᴊᴜꜱᴛ ɢᴏᴛ ʟᴏꜱᴛ ɪɴ ʏᴏᴜʀ ᴇʏᴇꜱ❤️😘.",
"ʏᴏᴜ ᴏᴡᴇ ᴍᴇ ᴀ ᴅʀɪɴᴋ❤️😘. ʙᴇᴄᴀᴜꜱᴇ ᴡʜᴇɴ ɪ ꜱᴀᴡ ʏᴏᴜ, ɪ ᴅʀᴏᴘᴘᴇᴅ ᴍɪɴᴇ❤️😘.",
"ᴛʜᴇʏ ꜱᴀʏ ɴᴏᴛʜɪɴɢ ʟᴀꜱᴛꜱ ꜰᴏʀᴇᴠᴇʀ, ꜱᴏ ᴡɪʟʟ ʏᴏᴜ ʙᴇ ᴍʏ ɴᴏᴛʜɪɴɢ?",
"ᴡᴀɴᴛ ᴛᴏ ɢᴏ ᴏᴜᴛꜱɪᴅᴇ ꜰᴏʀ ꜱᴏᴍᴇ ꜰʀᴇꜱʜ ᴀɪʀ? ʏᴏᴜ ᴛᴏᴏᴋ ᴍʏ ʙʀᴇᴀᴛʜ ᴀᴡᴀʏ❤️😘.",
"ɪꜰ ʏᴏᴜ ᴡᴇʀᴇ ᴀ ꜱᴏɴɢ, ʏᴏᴜ🥀'ᴅ ʙᴇ ᴛʜᴇ ʙᴇꜱᴛ ꜱɪɴɢʟᴇ ᴏɴ ᴛʜᴇ ᴀʟʙᴜᴍ❤️😘.",
"ʏᴏᴜ ʀᴇᴍɪɴᴅ ᴍᴇ ᴏꜰ ᴀ ᴍᴀɢɴᴇᴛ ʙᴇᴄᴀᴜꜱᴇ ʏᴏᴜ ꜱᴜʀᴇ ᴀʀᴇ ᴀᴛᴛʀᴀᴄᴛɪɴɢ ᴍᴇ ᴏᴠᴇʀ ʜᴇʀᴇ❤️😘.",
"ɪ👀’ᴍ ɢᴏɪɴɢ ᴛᴏ ʜᴀᴠᴇ ᴛᴏ ᴀꜱᴋ ʏᴏᴜ ᴛᴏ ʟᴇᴀᴠᴇ, ʏᴏᴜ👀’ʀᴇ ᴍᴀᴋɪɴɢ ᴇᴠᴇʀʏᴏɴᴇ ᴇʟꜱᴇ ɪɴ ʜᴇʀᴇ ʟᴏᴏᴋ ʙᴀᴅ",
"ᴍʏ ᴘᴀʀᴇɴᴛꜱ ᴛᴏʟᴅ ᴍᴇ ɴᴏᴛ ᴛᴏ ᴛᴀʟᴋ ᴛᴏ ꜱᴛʀᴀɴɢᴇʀꜱ, ʙᴜᴛ ɪ👀’ʟʟ ᴍᴀᴋᴇ ᴀɴ ᴇxᴄᴇᴘᴛɪᴏɴ ꜰᴏʀ ʏᴏᴜ",
"ᴡʜᴇɴ ɪ ꜱᴇɴᴅ ʏᴏᴜʀ ᴘɪᴄ ᴛᴏ ᴍʏ ɢʀᴏᴜᴘ ᴄʜᴀᴛ, ᴡʜɪᴄʜ ᴏɴᴇ ᴡᴏᴜʟᴅ ʏᴏᴜ ʟɪᴋᴇ ᴍᴇ ᴛᴏ ᴜꜱᴇ?",
"ᴡʜᴇɴ ʏᴏᴜʀ ᴘᴀʀᴇɴᴛꜱ ᴍᴀᴅᴇ ʏᴏᴜ, ᴛʜᴇʏ ᴡᴇʀᴇ ʀᴇᴀʟʟʏ ᴊᴜꜱᴛ ꜱʜᴏᴡɪɴɢ ᴏꜰꜰ",
"ɪ ᴋɴᴏᴡ ʏᴏᴜʀ ɴᴀᴍᴇ ɪꜱ [ɪɴꜱᴇʀᴛ ᴛʜᴇɪʀ ɴᴀᴍᴇ], ʙᴜᴛ ᴄᴀɴ ɪ ᴄᴀʟʟ ʏᴏᴜ ᴍɪɴᴇ?",
"ᴅᴏ ʏᴏᴜ ʙᴇʟɪᴇᴠᴇ ɪɴ ʟᴏᴠᴇ ᴀᴛ ꜰɪʀꜱᴛ ꜱɪɢʜᴛ, ᴏʀ ᴅᴏ ʏᴏᴜ ɴᴇᴇᴅ ᴛᴏ ʟᴏᴏᴋ ᴀᴛ ᴍʏ ᴘʀᴏꜰɪʟᴇ ᴀɢᴀɪɴ?",
"ᴀꜱɪᴅᴇ ꜰʀᴏᴍ ʙᴇɪɴɢ ᴛʜɪꜱ ɢᴏᴏᴅ-ʟᴏᴏᴋɪɴɢ, ᴡʜᴀᴛ ᴇʟꜱᴇ ᴅᴏ ʏᴏᴜ ᴅᴏ ɪɴ ʏᴏᴜʀ ꜰʀᴇᴇ ᴛɪᴍᴇ?",
"ɪ ᴅᴏɴ👀’ᴛ ʙᴇʟɪᴇᴠᴇ ɪɴ ʟᴏᴠᴇ ᴀᴛ ꜰɪʀꜱᴛ ꜱɪɢʜᴛ, ʙᴜᴛ ʏᴏᴜ ʜᴀᴠᴇ ᴍᴇ ᴄᴏɴꜱɪᴅᴇʀɪɴɢ ʟᴏᴠᴇ ᴀᴛ ꜰɪʀꜱᴛ ꜱᴡɪᴘᴇ❤️😘.",
"ɪ👀’ᴅ ꜱᴀʏ ʙʟᴇꜱꜱ ʏᴏᴜ, ʙᴜᴛ ɪᴛ ʟᴏᴏᴋꜱ ʟɪᴋᴇ ʏᴏᴜ ᴀʟʀᴇᴀᴅʏ ʜᴀᴠᴇ ʙᴇᴇɴ❤️😘.",
"ᴅᴏ ʏᴏᴜ ʜᴀᴠᴇ ᴀ ᴍᴀᴘ? ɪ ᴊᴜꜱᴛ ɢᴏᴛ ʟᴏꜱᴛ ɪɴ ʏᴏᴜʀ ᴇʏᴇꜱ❤️😘.",
"ᴍʏ ᴍᴏᴍ ᴛᴏʟᴅ ᴍᴇ ɴᴏᴛ ᴛᴏ ᴛᴀʟᴋ ᴛᴏ ꜱᴛʀᴀɴɢᴇʀꜱ ᴏɴʟɪɴᴇ, ʙᴜᴛ ɪ👀’ʟʟ ᴍᴀᴋᴇ ᴀɴ ᴇxᴄᴇᴘᴛɪᴏɴ ꜰᴏʀ ʏᴏᴜ",
"ꜱᴏᴍᴇᴛʜɪɴɢ👀’ꜱ ᴡʀᴏɴɢ ᴡɪᴛʜ ᴍʏ ᴇʏᴇꜱ ʙᴇᴄᴀᴜꜱᴇ ɪ ᴄᴀɴ👀’ᴛ ᴛᴀᴋᴇ ᴛʜᴇᴍ ᴏꜰꜰ ᴏꜰ ʏᴏᴜ❤️😘.",
"ᴡᴇʟʟ, ʜᴇʀᴇ ɪ ᴀᴍ! ᴡʜᴀᴛ ᴀʀᴇ ʏᴏᴜʀ ᴏᴛʜᴇʀ ᴛᴡᴏ ᴡɪꜱʜᴇꜱ?",
"ᴛʜᴇʏ ꜱᴀʏ ᴅᴀᴛɪɴɢ ɪꜱ ᴀ ɴᴜᴍʙᴇʀꜱ ɢᴀᴍᴇ, ꜱᴏ ᴄᴀɴ ɪ ɢᴇᴛ ʏᴏᴜʀꜱ?",
"ᴀʀᴇ ʏᴏᴜ ᴀ ᴍᴀɢɪᴄɪᴀɴ? ‘ᴄᴜᴢ ᴡʜᴇɴ ɪ ʟᴏᴏᴋ ᴀᴛ ʏᴏᴜ, ᴇᴠᴇʀʏᴏɴᴇ ᴇʟꜱᴇ ᴅɪꜱᴀᴘᴘᴇᴀʀꜱ❤️😘.",
"ᴅᴏ ʏᴏᴜ ᴋɴᴏᴡ ᴡʜᴀᴛ ᴛʜᴇ ʟɪᴛᴛʟᴇ ᴍᴇʀᴍᴀɪᴅ ᴀɴᴅ ɪ ʜᴀᴠᴇ ɪɴ ᴄᴏᴍᴍᴏɴ? ᴡᴇ ʙᴏᴛʜ ᴡᴀɴᴛ ᴛᴏ ʙᴇ ᴀ ᴘᴀʀᴛ ᴏꜰ ʏᴏᴜʀ ᴡᴏʀʟᴅ❤️😘.",
"ɪ👀’ᴅ ʟɪᴋᴇ ᴛᴏ ᴛᴀᴋᴇ ʏᴏᴜ ᴛᴏ ᴛʜᴇ ᴍᴏᴠɪᴇꜱ, ʙᴜᴛ ᴛʜᴇʏ ᴅᴏɴ👀’ᴛ ʟᴇᴛ ʏᴏᴜ ʙʀɪɴɢ ɪɴ ʏᴏᴜʀ ᴏᴡɴ ꜱɴᴀᴄᴋꜱ❤️😘.",
"ᴛɪᴛᴀɴɪᴄ? ᴛʜᴀᴛ👀’ꜱ ᴍʏ ɪᴄᴇʙʀᴇᴀᴋᴇʀ❤️😘. ᴡʜᴀᴛ👀’ꜱ ᴜᴘ?",
"ɪ ʜᴏᴘᴇ ʏᴏᴜ ᴋɴᴏᴡ ᴄᴘʀ ‘ᴄᴜᴢ ʏᴏᴜ ᴊᴜꜱᴛ ᴛᴏᴏᴋ ᴍʏ ʙʀᴇᴀᴛʜ ᴀᴡᴀʏ!",
"ɪ👀’ᴍ ɢᴏɪɴɢ ᴛᴏ ᴄᴏᴍᴘʟᴀɪɴ ᴛᴏ ꜱᴘᴏᴛɪꜰʏ ᴀʙᴏᴜᴛ ʏᴏᴜ ɴᴏᴛ ʙᴇɪɴɢ ɪɴ ᴛʜɪꜱ ᴡᴇᴇᴋ👀’ꜱ ʜᴏᴛᴛᴇꜱᴛ ꜱɪɴɢʟᴇꜱ❤️😘.",
"ɪ ᴀᴍ ɴᴏᴛ ᴀ ᴘʜᴏᴛᴏɢʀᴀᴘʜᴇʀ, ʙᴜᴛ ɪ ᴄᴀɴ ᴇᴀꜱɪʟʏ ᴘɪᴄᴛᴜʀᴇ ᴜꜱ ᴛᴏɢᴇᴛʜᴇʀ❤️😘.",
"ᴋɪꜱꜱ ᴍᴇ ɪꜰ ɪ👀’ᴍ ᴡʀᴏɴɢ, ʙᴜᴛ ᴅɪɴᴏꜱᴀᴜʀꜱ ꜱᴛɪʟʟ ᴇxɪꜱᴛ, ʀɪɢʜᴛ?",
"ʜᴇʏ, ʏᴏᴜ👀’ʀᴇ ᴘʀᴇᴛᴛʏ ᴀɴᴅ ɪ👀’ᴍ ᴄᴜᴛᴇ❤️😘. ᴛᴏɢᴇᴛʜᴇʀ ᴡᴇ👀’ᴅ ʙᴇ ᴘʀᴇᴛᴛʏ ᴄᴜᴛᴇ❤️😘.",
"ɪ ᴡᴏᴜʟᴅ ꜰʟɪʀᴛ ᴡɪᴛʜ ʏᴏᴜ, ʙᴜᴛ ɪ👀’ᴅ ʀᴀᴛʜᴇʀ ꜱᴇᴅᴜᴄᴇ ʏᴏᴜ ᴡɪᴛʜ ᴍʏ ᴀᴡᴋᴡᴀʀᴅɴᴇꜱꜱ❤️😘.",
"ɪ ᴜꜱᴜᴀʟʟʏ ɢᴏ ꜰᴏʀ 8ꜱ ʙᴜᴛ ɪ ɢᴜᴇꜱꜱ ɪ👀’ʟʟ ꜱᴇᴛᴛʟᴇ ꜰᴏʀ ᴀ 10❤️😘.",
"ᴀʀᴇ ʏᴏᴜ ʜᴛᴛᴘꜱ? ‘ᴄᴜᴢ ᴡɪᴛʜᴏᴜᴛ ʏᴏᴜ ɪ👀’ᴍ ᴊᴜꜱᴛ ://",
"ᴅᴏ ʏᴏᴜ ʟɪᴋᴇ ᴍᴇxɪᴄᴀɴ ꜰᴏᴏᴅ? ‘ᴄᴜᴢ ɪ ᴡᴀɴᴛ ᴛᴏ ᴡʀᴀᴘ ʏᴏᴜ ᴜᴘ ᴀɴᴅ ᴍᴀᴋᴇ ʏᴏᴜ ᴍʏ ʙᴀᴇ-ʀɪᴛᴛᴏ❤️😘.",
"ᴛʀᴜᴛʜ ᴏʀ ᴅᴀᴛᴇ?",
"ʜɪ, ɪ👀’ᴍ ᴍʀꜱ❤️😘. ʀɪɢʜᴛ❤️😘. ꜱᴏᴍᴇᴏɴᴇ ꜱᴀɪᴅ ʏᴏᴜ ᴡᴇʀᴇ ʟᴏᴏᴋɪɴɢ ꜰᴏʀ ᴍᴇ?",
"ʏᴏᴜ ᴅᴏɴ👀’ᴛ ᴋɴᴏᴡ ʜᴏᴡ ᴍᴀɴʏ ᴛɪᴍᴇꜱ ɪ👀’ᴠᴇ ʜᴀᴅ ᴛᴏ ꜱᴡɪᴘᴇ ʟᴇꜰᴛ ᴛᴏ ꜰɪɴᴅ ʏᴏᴜ❤️😘.",
"ᴡʜᴇɴ ᴏᴜʀ ꜰʀɪᴇɴᴅꜱ ᴀꜱᴋ ᴜꜱ ʜᴏᴡ ᴡᴇ ᴍᴇᴛ, ᴡʜᴀᴛ ᴀʀᴇ ᴡᴇ ɢᴏɪɴɢ ᴛᴏ ᴛᴇʟʟ ᴛʜᴇᴍ? ꜰᴜɴɴʏ ᴀɴꜱᴡᴇʀꜱ ᴏɴʟʏ❤️😘.",
"ɪꜰ ʏᴏᴜ ᴄᴏᴜʟᴅ ʙᴇ ᴀɴʏᴡʜᴇʀᴇ ɪɴ ᴛʜᴇ ᴡᴏʀʟᴅ, ᴅᴏɪɴɢ ᴀɴʏᴛʜɪɴɢ ʏᴏᴜ ᴡᴀɴᴛᴇᴅ, ᴡʜᴇʀᴇ ᴡᴏᴜʟᴅ ᴡᴇ ʙᴇ?",
"ɪ ᴅᴏɴ👀’ᴛ ᴋɴᴏᴡ ʜᴏᴡ ᴛʜɪꜱ ᴡᴏʀᴋꜱ❤️😘. ᴀʀᴇ ᴡᴇ ᴍᴀʀʀɪᴇᴅ ɴᴏᴡ?",
"ʜᴇʏ, ɪ👀’ᴍ ᴡʀɪᴛɪɴɢ ᴀɴ ᴀʀᴛɪᴄʟᴇ ᴏɴ ᴛʜᴇ ꜰɪɴᴇʀ ᴛʜɪɴɢꜱ ɪɴ ʟɪꜰᴇ ᴀɴᴅ ᴡᴀꜱ ʜᴏᴘɪɴɢ ɪ ᴄᴏᴜʟᴅ ɪɴᴛᴇʀᴠɪᴇᴡ ʏᴏᴜ❤️😘.",
"ɴᴏᴛ ᴛᴏ ʙᴇ ᴄʜᴇᴇꜱʏ, ʙᴜᴛ ᴏʜ ᴍʏ ɢᴏᴅ ʏᴏᴜ👀’ʀᴇ ɢᴏʀɢᴇᴏᴜꜱ!",
"ᴍʏ ꜱᴡᴇᴇᴛ ᴛᴏᴏᴛʜ ʜᴀꜱ ʙᴇᴇɴ ᴅʀɪᴠɪɴɢ ᴍᴇ ᴄʀᴀᴢʏ ꜱɪɴᴄᴇ ᴛʜᴇ ꜱᴇᴄᴏɴᴅ ɪ ꜱᴀᴡ ʏᴏᴜʀ ᴘʀᴏꜰɪʟᴇ!",
"ɪ ʜᴀᴅ ᴛʜɪꜱ ᴀᴡᴇꜱᴏᴍᴇ ᴘɪᴄᴋᴜᴘ ʟɪɴᴇ, ʙᴜᴛ ɪ ꜰᴏʀɢᴏᴛ ɪᴛ ᴛʜᴇ ᴍᴏᴍᴇɴᴛ ɪ ʟᴀɪᴅ ᴇʏᴇꜱ ᴏɴ ʏᴏᴜ❤️😘.",
"ɪ ᴛʀɪᴘᴘᴇᴅ ᴡʜɪʟᴇ ʟᴏᴏᴋɪɴɢ ᴀᴛ ʏᴏᴜ❤️😘. ɪ ɢᴜᴇꜱꜱ ʏᴏᴜ ᴏᴡᴇ ᴍᴇ ᴀ ɴᴇᴡ ᴘᴀɪʀ ᴏꜰ ꜱʜᴏᴇꜱ❤️😘.",
"ɪ ʜᴀᴅ ᴛʜᴇ ʙᴇꜱᴛ ᴘɪᴄᴋᴜᴘ ʟɪɴᴇ ᴏɴ ᴛʜᴇ ᴡᴀʏ, ʙᴜᴛ ɪ ꜱᴀᴡ ʏᴏᴜ ᴀɴᴅ ɴᴏᴡ ɪ🥀'ᴍ ꜱᴘᴇᴇᴄʜʟᴇꜱꜱ❤️😘.",
"ɪꜰ ʏᴏᴜ ᴡᴇʀᴇ ᴀ ꜰʀᴜɪᴛ, ʏᴏᴜ👀’ᴅ ʙᴇ ᴀ ꜰɪɴᴇᴀᴘᴘʟᴇ❤️😘. ʙᴀ ᴅᴜᴍ ᴛꜱꜱ❤️😘.",
"ɪ ᴀꜱꜱᴜᴍᴇᴅ ʜᴀᴘᴘɪɴᴇꜱꜱ ꜱᴛᴀʀᴛᴇᴅ ᴡɪᴛʜ ᴀɴ ‘ʜ👀’ ʙᴜᴛ ɪ ʙᴇʟɪᴇᴠᴇ ɪᴛ ᴀᴄᴛᴜᴀʟʟʏ ꜱᴛᴀʀᴛꜱ ᴡɪᴛʜ ‘ᴜ❤️😘.👀’",
"ᴀʀᴇ ʏᴏᴜ ᴍʏ ᴀᴘᴘᴇɴᴅɪx? ‘ᴄᴜᴢ ᴛʜɪꜱ ꜰᴇᴇʟɪɴɢ ɪɴ ᴍʏ ꜱᴛᴏᴍᴀᴄʜ ᴍᴀᴋᴇꜱ ᴍᴇ ᴡᴀɴᴛ ᴛᴏ ᴛᴀᴋᴇ ʏᴏᴜ ᴏᴜᴛ💗💫.",
"ᴏɴ ᴀ ꜱᴄᴀʟᴇ ᴏꜰ 1 ᴛᴏ 10, ʏᴏᴜ👀’ʀᴇ ᴀ 9, ᴀɴᴅ ɪ👀’ᴍ ᴛʜᴇ 1 ʏᴏᴜ ɴᴇᴇᴅ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ᴀ ꜰʀᴜɪᴛ ‘ᴄᴜᴢ ᴡᴇ ᴄᴏᴜʟᴅ ᴍᴀᴋᴇ ᴀ ɢʀᴇᴀᴛ ᴘᴇᴀʀ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ᴀ ᴛɪᴍᴇ ᴛʀᴀᴠᴇʟᴇʀ? ‘ᴄᴜᴢ ɪ ꜱᴇᴇ ʏᴏᴜ ɪɴ ᴍʏ ꜰᴜᴛᴜʀᴇ💗💫.",
"ᴅᴏ ʏᴏᴜ ʟɪᴋᴇ ʙᴀɢᴇʟꜱ? ʙᴇᴄᴀᴜꜱᴇ ʏᴏᴜ👀’ʀᴇ ʙᴀᴇ ɢᴏᴀʟꜱ💗💫.",
"ʀᴏꜱᴇꜱ ᴀʀᴇ ʀᴇᴅ, ᴠɪᴏʟᴇᴛꜱ ᴀʀᴇ ʙʟᴜᴇ, ʜᴏᴡ ᴅɪᴅ ɪ ɢᴇᴛ ꜱᴏ ʟᴜᴄᴋʏ ᴛᴏ ᴍᴀᴛᴄʜ ᴡɪᴛʜ ʏᴏᴜ?",
"ᴅᴏ ʏᴏᴜ ᴡᴀᴛᴄʜ ꜱᴛᴀʀ ᴡᴀʀꜱ? ʙᴇᴄᴀᴜꜱᴇ ʏᴏᴅᴀ ᴏɴʟʏ ᴏɴᴇ ꜰᴏʀ ᴍᴇ💗💫.",
"ʜɪ, ᴍʏ ɴᴀᴍᴇ ɪꜱ [ɪɴꜱᴇʀᴛ ʏᴏᴜʀ ɴᴀᴍᴇ], ʙᴜᴛ ʏᴏᴜ ᴄᴀɴ ᴄᴀʟʟ ᴍᴇ ᴛᴏɴɪɢʜᴛ ᴏʀ ᴛᴏᴍᴏʀʀᴏᴡ💗💫.",
"ɪ👀’ᴍ ɴᴏ ᴏʀɢᴀɴ ᴅᴏɴᴏʀ ʙᴜᴛ ɪ👀’ᴅ ʙᴇ ʜᴀᴘᴘʏ ᴛᴏ ɢɪᴠᴇ ʏᴏᴜ ᴍʏ ʜᴇᴀʀᴛ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ᴀ ʙᴀɴᴋ ʟᴏᴀɴ? ‘ᴄᴜᴢ ʏᴏᴜ ʜᴀᴠᴇ ᴍʏ ɪɴᴛᴇʀᴇꜱᴛ💗💫.",
"ʟɪꜰᴇ ᴡɪᴛʜᴏᴜᴛ ʏᴏᴜ ɪꜱ ʟɪᴋᴇ ᴀ ʙʀᴏᴋᴇɴ ᴘᴇɴᴄɪʟ… ᴘᴏɪɴᴛʟᴇꜱꜱ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ʀᴇʟɪɢɪᴏᴜꜱ? ‘ᴄᴜᴢ ʏᴏᴜ👀’ʀᴇ ᴛʜᴇ ᴀɴꜱᴡᴇʀ ᴛᴏ ᴀʟʟ ᴏꜰ ᴍʏ ᴘʀᴀʏᴇʀꜱ💗💫.",
"ɪ ᴍᴜꜱᴛ ʙᴇ ɪɴ ᴀ ᴍᴜꜱᴇᴜᴍ ʙᴇᴄᴀᴜꜱᴇ ʏᴏᴜ ᴛʀᴜʟʏ ᴀʀᴇ ᴀ ᴡᴏʀᴋ ᴏꜰ ᴀʀᴛ💗💫.",
"ʟᴇᴛ👀’ꜱ ᴄᴏᴍᴍɪᴛ ᴛʜᴇ ᴘᴇʀꜰᴇᴄᴛ ᴄʀɪᴍᴇ💗💫. ɪ👀’ʟʟ ꜱᴛᴇᴀʟ ʏᴏᴜʀ ʜᴇᴀʀᴛ, ʏᴏᴜ ꜱᴛᴇᴀʟ ᴍɪɴᴇ💗💫.",
"ᴇᴠᴇɴ ɪꜰ ᴛʜᴇʀᴇ ᴡᴀꜱ ɴᴏ ɢʀᴀᴠɪᴛʏ ᴏɴ ᴇᴀʀᴛʜ, ɪ👀’ᴅ ꜱᴛɪʟʟ ꜰᴀʟʟ ꜰᴏʀ ʏᴏᴜ💗💫.",
"ᴛʜᴇʏ ꜱᴀʏ ɴᴏᴛʜɪɴɢ ʟᴀꜱᴛꜱ ꜰᴏʀᴇᴠᴇʀ, ꜱᴏ ᴡɪʟʟ ʏᴏᴜ ʙᴇ ᴍʏ ɴᴏᴛʜɪɴɢ?",
"ᴡᴇʟʟ, ʏᴏᴜ👀’ʀᴇ ᴛʜᴇ ꜱᴡᴇᴇᴛᴇꜱᴛ ᴛʜɪɴɢ ɪ👀’ᴠᴇ ꜱᴇᴇɴ ɪɴ ᴀ ᴡʜɪʟᴇ ᴏɴ ᴛʜɪꜱ ᴀᴘᴘ💗💫. ʜᴇʟʟᴏ ᴛʜᴇʀᴇ!",
"ᴀʀᴇ ʏᴏᴜ ᴀɴ ᴀʀᴄʜᴇᴏʟᴏɢɪꜱᴛ ‘ᴄᴜᴢ ʏᴏᴜ ᴅᴜɢ ᴜᴘ ᴀ ʜᴏʟᴇ ɪɴ ᴍʏ ʜᴇᴀʀᴛ💗💫.",
"ᴄᴏꜰꜰᴇᴇ, ᴛᴇᴀ, ᴏʀ ꜱᴜꜱʜɪ?",
"ʏᴏᴜ ʜᴀᴠᴇ ᴏɴᴇ ᴏꜰ ᴛʜᴇ ᴍᴏꜱᴛ ʙᴇᴀᴜᴛɪꜰᴜʟ ꜰᴀᴄᴇꜱ ɪ👀’ᴠᴇ ꜱᴇᴇɴ ɪɴ ᴀ ʟᴏɴɢ, ʟᴏɴɢ ᴛɪᴍᴇ💗💫.",
"ᴅᴏ ʏᴏᴜ ᴋɴᴏᴡ ʜᴏᴡ ᴛᴏ ᴛʀᴀɪɴ ʙᴜᴛᴛᴇʀꜰʟɪᴇꜱ? ᴛʜᴇ ᴏɴᴇꜱ ɪɴ ᴍʏ ꜱᴛᴏᴍᴀᴄʜ ʀɪɢʜᴛ ɴᴏᴡ ᴀʀᴇ Qᴜɪᴛᴇ ᴜɴᴛᴀᴍᴇᴅ💗💫.",
"ꜱᴡɪᴘᴇᴅ ꜰᴏʀ ᴛʜᴇ ᴅᴏɢ, ꜱᴛᴀʏᴇᴅ ꜰᴏʀ ᴛʜᴇ ʜᴜᴍᴀɴ💗💫.",
"ɪ👀’ᴍ ᴛʀʏɪɴɢ ᴛᴏ ᴛʜɪɴᴋ ᴏꜰ ꜱᴏᴍᴇᴛʜɪɴɢ ᴛᴏ ꜱᴀʏ, ʙᴜᴛ ᴀʟʟ ɪ ᴄᴀɴ ᴛʜɪɴᴋ ᴀʙᴏᴜᴛ ɪꜱ ʜᴏᴡ ᴄᴜᴛᴇ ʏᴏᴜ ᴀʀᴇ💗💫.",
"ɪ👀’ᴅ ɢɪᴠᴇ ᴜᴘ ᴍʏ ᴍᴏʀɴɪɴɢ ᴄᴇʀᴇᴀʟ ᴛᴏ ꜱᴘᴏᴏɴ ʏᴏᴜ ɪɴꜱᴛᴇᴀᴅ💗💫.",
"ɪᴛ ʟᴏᴏᴋꜱ ʟɪᴋᴇ ɪ👀’ᴠᴇ ʟᴏꜱᴛ ᴍʏ ᴘʜᴏɴᴇ ɴᴜᴍʙᴇʀ💗💫. ᴄᴏᴜʟᴅ ɪ ɢᴇᴛ ʏᴏᴜʀꜱ ɪɴꜱᴛᴇᴀᴅ?",
"ʏᴏᴜ ꜱᴡɪᴘᴇᴅ ʀɪɢʜᴛ, ɪ ꜱᴡɪᴘᴇᴅ ʀɪɢʜᴛ, ꜱʜᴏᴜʟᴅ ᴡᴇ ᴇꜱᴛᴀʙʟɪꜱʜ ᴡᴇ👀’ʀᴇ ɴᴏᴛ ꜱᴇʀɪᴀʟ ᴋɪʟʟᴇʀꜱ ꜰɪʀꜱᴛ ᴏʀ ᴄᴀɴ ᴡᴇ ᴘʀᴏᴄᴇᴇᴅ ᴛᴏ ᴅᴀᴛᴇ ʀɪɢʜᴛ ᴀᴡᴀʏ?",
"ɴᴏ ᴘᴇɴ, ɴᴏ ᴘᴀᴘᴇʀ… ʙᴜᴛ ʏᴏᴜ ꜱᴛɪʟʟ ‘ᴅʀᴀᴡ👀’ ᴍʏ ᴀᴛᴛᴇɴᴛɪᴏɴ💗💫.",
"ɪ👀’ᴍ ʀᴇꜱᴇᴀʀᴄʜɪɴɢ ɪᴍᴘᴏʀᴛᴀɴᴛ ᴅᴀᴛᴇꜱ ɪɴ ʜɪꜱᴛᴏʀʏ💗💫. ᴡᴏᴜʟᴅ ʏᴏᴜ ʟɪᴋᴇ ᴛᴏ ʙᴇ ᴍɪɴᴇ?",
"ᴅᴀᴍɴ, ʏᴏᴜ ʜᴀᴠᴇ ᴀ ᴅᴏɢ! ᴅᴏᴇꜱ ᴛʜᴀᴛ ᴍᴇᴀɴ ɪ👀’ʟʟ ɴᴇᴠᴇʀ ᴡɪɴ ᴛʜᴇ ‘ʙᴇꜱᴛ ᴄᴜᴅᴅʟᴇʀ ᴇᴠᴇʀ👀’ ᴛɪᴛʟᴇ?",
"ɪ👀’ᴍ ɴᴏᴛ ᴀɴ ᴇʟᴇᴄᴛʀɪᴄɪᴀɴ, ʙᴜᴛ ɪ ᴄᴀɴ ʟɪɢʜᴛ ᴜᴘ ʏᴏᴜʀ ᴅᴀʏ💗💫.",
"ɪ ᴋɴᴏᴡ ᴡᴇ👀’ʀᴇ ɴᴏᴛ ꜱᴏᴄᴋꜱ, ʙᴜᴛ ɪ👀’ᴍ ꜱᴜʀᴇ ᴡᴇ👀’ᴅ ᴍᴀᴋᴇ ᴀ ɢʀᴇᴀᴛ ᴘᴀɪʀ💗💫.",
"ɪ ᴛʜɪɴᴋ ꜱᴏᴍᴇᴏɴᴇ ᴍᴜꜱᴛ ʜᴀᴠᴇ ꜱᴛᴏʟᴇɴ ᴛʜᴇ ꜱᴛᴀʀꜱ ᴀɴᴅ ᴘᴜᴛ ᴛʜᴇᴍ ɪɴ ʏᴏᴜʀ ᴇʏᴇꜱ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ɢᴏᴏᴅ ᴀᴛ ᴀʟɢᴇʙʀᴀ? ‘ᴄᴜᴢ ɪ👀’ᴅ ʟɪᴋᴇ ʏᴏᴜ ᴛᴏ ʀᴇᴘʟᴀᴄᴇ ᴍʏ x ᴡɪᴛʜᴏᴜᴛ ᴀꜱᴋɪɴɢ ʏ💗💫.",
"ᴏʜ, ʙʏ ᴛʜᴇ ᴡᴀʏ, ɪ👀’ᴍ ᴡᴇᴀʀɪɴɢ ᴛʜᴀᴛ ꜱᴍɪʟᴇ ʏᴏᴜ ɢᴀᴠᴇ ᴍᴇ💗💫.",
"ᴅᴏ ʏᴏᴜ ʜᴀᴠᴇ ᴀ ᴘᴇɴᴄɪʟ? ‘ᴄᴜᴢ ɪ ᴡᴀɴᴛ ᴛᴏ ᴇʀᴀꜱᴇ ʏᴏᴜʀ ᴘᴀꜱᴛ ᴀɴᴅ ᴡʀɪᴛᴇ ᴏᴜʀ ꜰᴜᴛᴜʀᴇ💗💫.",
"ʏᴏᴜ ᴋɴᴏᴡ ᴛʜᴏꜱᴇ ɢᴀᴘꜱ ʙᴇᴛᴡᴇᴇɴ ʏᴏᴜʀ ꜰɪɴɢᴇʀꜱ? ɪ ᴛʜɪɴᴋ ᴛʜᴇʏ ᴡᴇʀᴇ ᴍᴀᴅᴇ ꜰᴏʀ ᴍɪɴᴇ💗💫.",
"ᴍɪɴᴅ ɪꜰ ɪ ᴛɪᴇ ʏᴏᴜʀ ꜱʜᴏᴇꜱ? ɪ👀’ᴅ ʜᴀᴛᴇ ᴛᴏ ꜱᴇᴇ ʏᴏᴜ ꜰᴀʟʟɪɴɢ ꜰᴏʀ ᴀɴʏᴏɴᴇ ᴇʟꜱᴇ💗💫.",
"ʏᴏᴜ ᴍᴀᴋᴇ ᴍʏ ꜱᴘɪᴅᴇʏ ꜱᴇɴꜱᴇ ᴛɪɴɢʟᴇ💗💫.",
"ꜱᴀᴡ ʏᴏᴜ👀’ʀᴇ ᴀ ꜰᴏᴏᴅɪᴇ, ɪ ᴋɴᴏᴡ ᴀ ꜰᴇᴡ ᴛʜɪɴɢꜱ ʏᴏᴜ ᴄᴏᴜʟᴅ ᴛᴀꜱᴛᴇ💗💫.",
"ᴀʀᴇ ʏᴏᴜ ᴀꜱ ɢᴏᴏᴅ ᴀᴛ ᴄᴜᴅᴅʟɪɴɢ ᴀꜱ ʏᴏᴜ ᴀʀᴇ ɢᴏᴏᴅ-ʟᴏᴏᴋɪɴɢ? ɪꜰ ꜱᴏ, ᴡʜᴇɴ ᴄᴀɴ ɪ ɢᴇᴛ ᴀ ᴄᴜᴅᴅʟᴇ?",
"ᴡᴀɴᴛ ᴛᴏ ʜᴇʟᴘ ᴍᴇ ɢᴇᴛ ᴏɴ ꜱᴀɴᴛᴀ👀’ꜱ ɴᴀᴜɢʜᴛʏ ʟɪꜱᴛ ᴛʜɪꜱ ʏᴇᴀʀ?",
"ʏᴏᴜ ʟᴏᴏᴋ ʟɪᴋᴇ ʏᴏᴜ ᴋɴᴏᴡ ʜᴏᴡ ᴛᴏ ʜᴀᴠᴇ ᴀ ɢᴏᴏᴅ ᴛɪᴍᴇ! ɪ ʟɪᴋᴇ ɪᴛ💗💫.",
"ʏᴏᴜʀ ʟɪᴘꜱ ʟᴏᴏᴋ ʟᴏɴᴇʟʏ💗💫. ᴡᴏᴜʟᴅ ᴛʜᴇʏ ʟɪᴋᴇ ᴛᴏ ᴍᴇᴇᴛ ᴍɪɴᴇ?",
"ɪ ᴋɴᴏᴡ ʏᴏᴜ👀’ʀᴇ ʙᴜꜱʏ, ʙᴜᴛ ᴘʟᴇᴀꜱᴇ ᴀᴅᴅ ᴍᴇ ᴛᴏ ʏᴏᴜʀ ʟɪꜱᴛ ᴏꜰ ᴛʜɪɴɢꜱ ᴛᴏ ᴅᴏ💗💫.",
"ɪ👀’ᴠᴇ ʜᴇᴀʀᴅ ɪᴛ ꜱᴀɪᴅ ᴛʜᴀᴛ ᴋɪꜱꜱɪɴɢ ɪꜱ ᴛʜᴇ ‘ʟᴀɴɢᴜᴀɢᴇ ᴏꜰ ʟᴏᴠᴇ💗💫.👀’ ᴡᴏᴜʟᴅ ʏᴏᴜ ᴄᴀʀᴇ ᴛᴏ ʜᴀᴠᴇ ᴀ ᴄᴏɴᴠᴇʀꜱᴀᴛɪᴏɴ ᴡɪᴛʜ ᴍᴇ ᴀʙᴏᴜᴛ ɪᴛ ꜱᴏᴍᴇᴛɪᴍᴇ?",
"ɪꜰ ʏᴏᴜ ʟᴇᴛ ᴍᴇ ʙᴏʀʀᴏᴡ ᴀ ᴋɪꜱꜱ, ɪ ᴘʀᴏᴍɪꜱᴇ ɪ👀’ʟʟ ɢɪᴠᴇ ɪᴛ ʀɪɢʜᴛ ʙᴀᴄᴋ💗💫.",
"ᴡʜᴇɴ ɪ ᴍᴀᴋᴇ ʏᴏᴜ ʙʀᴇᴀᴋꜰᴀꜱᴛ ɪɴ ᴛʜᴇ ᴍᴏʀɴɪɴɢ, ᴡʜᴀᴛ ᴡᴏᴜʟᴅ ʏᴏᴜ ʟɪᴋᴇ?",
"ɪ ᴊᴜꜱᴛ ʙᴏᴜɢʜᴛ ᴋɪꜱꜱ-ᴘʀᴏᴏꜰ ʟɪᴘꜱᴛɪᴄᴋ, ᴀɴᴅ ɪ ɴᴇᴇᴅ ᴀ ʟᴀʙ ᴘᴀʀᴛɴᴇʀ ᴛᴏ ᴛᴇꜱᴛ ɪᴛꜱ ᴄʟᴀɪᴍꜱ💗💫. ᴀʀᴇ ʏᴏᴜ ɪɴ?👀’",
"ɪꜰ ɪ ᴛᴏʟᴅ ʏᴏᴜ ᴛʜᴀᴛ ʏᴏᴜ ʜᴀᴅ ᴀ ɢʀᴇᴀᴛ ʙᴏᴅʏ, ᴡᴏᴜʟᴅ ʏᴏᴜ ʜᴏʟᴅ ɪᴛ ᴀɢᴀɪɴꜱᴛ ᴍᴇ?",
